<html>

<head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <meta http-equiv="Content-Style-Type" content="text/css" />
    <title></title>
    <style>
        .invoice-box {
            max-width: 890px;
            margin: auto;
            padding: 10px;
            border: 1px solid #eee;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.15);
            font-size: 14px;
            line-height: 24px;
            font-family: "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif;
            color: #555;
        }

        .invoice-box table {
            width: 100%;
            line-height: inherit;
            text-align: left;
        }

        .invoice-box table td {
            padding: 5px;
            vertical-align: middle;
        }

        .invoice-box table tr td:nth-child(2) {
            text-align: right;
        }

        .invoice-box table tr.top table td {
            padding-bottom: 20px;
        }

        .invoice-box table tr.top table td.title {
            font-size: 45px;
            line-height: 45px;
            color: #333;
        }

        .invoice-box table tr.information table td {
            padding-bottom: 40px;
        }

        .invoice-box table tr.heading td {
            /* background: #eee;
            border-bottom: 1px solid #ddd;
            font-weight: bold;
            font-size: 12px; */
        }

        .invoice-box table tr.details td {
            padding-bottom: 20px;
        }

        .invoice-box table tr.item td {
            border-bottom: 1px solid #eee;
        }

        .invoice-box table tr.item.last td {
            border-bottom: none;
        }

        .invoice-box table tr.total td:nth-child(2) {
            border-top: 2px solid #eee;
            font-weight: bold;
        }

        @media only screen and (max-width: 600px) {
            .invoice-box table tr.top table td {
                width: 100%;
                display: block;
                text-align: center;
            }

            .invoice-box table tr.information table td {
                width: 100%;
                display: block;
                text-align: center;
            }
        }

        /** RTL **/
        .rtl {
            direction: rtl;
            font-family: Tahoma, "Helvetica Neue", "Helvetica", Helvetica, Arial,
                sans-serif;
        }

        .rtl table {
            text-align: right;
        }

        .rtl table tr td:nth-child(2) {
            text-align: left;
        }

        .stripped tr:nth-child(even) {
            background-color: rgb(114, 195, 202);
        }

        .image1 {
            background: url('data:image/png;base64,') center no-repeat; padding-top: 100px;
            background-size: cover;
        }

        .image2 {
            background: url('data:image/png;base64,') center no-repeat; background-size: cover;
        }
        .stripped td:nth-child(1) {
            width:35%;
        }
        .stripped td:nth-child(2) {
            width:15%; text-align:center !important;
        }
        .stripped td:nth-child(3) {
            width:10%; text-align:center;
        }
        .stripped td:nth-child(4) {
           width:15%; text-align:center;
        }
        .stripped td:nth-child(5) {
           width:15%; text-align:right;
        }
    </style>

</head>

<body>

    <div class="invoice-box">
        <div class="image1">
            <table cellpadding="0" cellspacing="0">
                <tr class="top_rw">
                    <td colspan="1">
                        {{ now()->format('d-m-Y H:i') }}
                    </td>
                    <td style="margin-right: 10px;">
                        Numro proforma : __NUMERO_PROFORMA__
                    </td>
                </tr>
                <tr class="top">
