                                </td>
                            </tr>
                        </table>
                    </td>
                </tr>
                <tr class="information">
                    <td colspan="3">
                        <div class="" style="margin-left: 50%">
                            <b>Client : __CLIENT_NOM__</b><br>
                            Adresse : __CLIENT_ADRESSE__<br>
                            Email : __CLIENT_EMAIL__<br>
                            Tel : __CLIENT_TELEPHONE__
                        </div>
                    </td>
                </tr>
            </table>
        </div>
        <table cellpadding="0" cellspacing="0">
            <tr></tr>
