                            PRIX
                        </td>
                        <td>
                            QTE
                        </td>
                        <td>
                            UNITE DE MESURE
                        </td>
                        <td>
                            TOTAL
                        </td>
                    </tr>
                    __ARTICLE_PROFORMA__
