                        <td> 57.97 </td>
                        <td> 380 </td>
                    </tr><tr rclass="item">
                        <td>
                            Article efyh
                        </td>
                        <td> 2 </td>
                        <td> 322.03 </td>
                        <td> 57.97 </td>
                        <td> 380 </td>
                    </tr> --}}
                </table>
            </td>
            </tr>
            <tr class="total">
                <td colspan="3">
                    <div style="text-align: right; font-weight: 900"> Total : <b>__TOTAL__</b> </div>
                </td>
            </tr>
        </table>
        <div class="image2">
            <table cellpadding="0" cellspacing="0">
                <tr>
                    <td colspan="3">
                        <table cellspacing="0px" cellpadding="2px">
                            <tr> <br> <br>
                                <p>__NOTE_REGLEMENT__</p>
                            </tr>
                            <tr>
                                <td> <br> <b> Mode de rglement : __MODE_REGLEMENT__<br> Conditions de rglement :
                                        __CONDITION_REGLEMENT__<br> Date limite de rglement : __DATE_REGLEMENT__<br>
                                    </b> </td>
                            </tr>
                            <tr>
                                <td colspan="3" style="text-align: center"> <br> <br> <br> <br> <br> <br>
                                    <small>__ENTREPRISE_NOM_ <br> __ENTREPRISE_ADRESSE__ </small> <br> <br> </td>
                            </tr>
                        </table>
                    </td>
                </tr>
            </table>
        </div>
    </div>
</body>

</html>
